import React from 'react';
import { View, Text, StyleSheet, Image } from 'react-native';



export function Home({ navigation }) {
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.heading}>Willkommen beim Time Managment System 2.0</Text>
        <Image source={require('./assets/HeroTMS.png')} style={styles.image} />
      </View>
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'top',
  },
  header: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    paddingHorizontal: 15,
    paddingBottom: 10,
    paddingTop: 10,
  },
  heading: {
    fontSize: 24,
  },
    image: {
    width: 100,  // oder jede andere gewünschte Breite
    height: 100, // oder jede andere gewünschte Höhe
    marginTop: 20, // optionaler Abstand nach oben
  },
});
